import React from "react";
import * as Function from "../../function.js";

function HistoryBet(props) {

    let winamount = 0;
    if ( props.value.winamount !== undefined )
        winamount = Function.addComma(props.value.betamount);

    return (
        <>
            <tr>
                <td>{props.value.betcode} {props.value.betvalue}</td>
                <td>{Function.addComma(props.value.betamount)}</td>
                <td>{winamount}</td>
            </tr>
        </>
    );
}

export default HistoryBet;
